    <style>
      * {
        font-family: 'Montserrat', sans-serif;
      }
      body {
        max-width: 700px;
        margin-left: auto;
        margin-right: auto;
      }
      .col-1 {
        display: flex;
      }
      .header {
        max-width: 300px;
        height: 110px;
        background-color: #ececec;
        text-align: center;
        padding: 24px 10px;
        box-sizing: border-box;
        z-index: 99;
      }
      .logo-img-text-div {
        font-style: italic;
        font-size: 16px;
        color: black;
        padding-top: 7px;
      }
      .img-div-col-1 {
        position: absolute;
        margin-left: 99px;
        margin-top: 23px;
      }
      .img-text-overlapped {
        min-width: 503px;
        height: 141px;
        background-color: black;
        z-index: 999;
        opacity: 0.4;
        position: relative;
        top: 250px;
        left: -92px;
      }
      .img-text-overlapped-col-3 {
        width: 400px;
        height: 166px;
        background-color: black;
        z-index: 999;
        opacity: 0.4;
        position: relative;
        top: -252px;
        left: 0px;
      }
      .parking-in-india {
        position: relative;
        top: 275px;
        left: -544px;
        z-index: 9999;
        padding: 0 29px;
      }
      .bringing-in-india {
        position: relative;
        bottom: 395px;
        /* left: -544px; */
        z-index: 9999;
        padding: 0 29px;
      }
      .col-2 {
        position: relative;
        top: 306px;
      }
      .flex-container {
        display: flex;
      }

      .flex-container > div {
        text-align: center;
        border: 8px solid #f1f1f1;
        margin: 10px;
        padding: 10px;
        font-size: 21px;
        width: 218px;
        height: px;
        font-style: italic;
        box-sizing: border-box;
      }
      .flex-container > span {
        position: relative;
        top: 50px;
      }
      .col-3 {
        position: relative;
        top: 328px;
      }
      .col-3-heading {
        text-align: center;
        font-size: 22px;
        font-style: italic;
      }
      .col-3-img {
        /* position: relative; */
        text-align: right;
        /* right:-108px */
      }
      .col-4 {
        position: relative;
        top: 80px;
      }
      .text-flex {
        font-size: 18px;
      }
      .col-5 {
        position: relative;
        top: 90px;
        text-align: center;
      }
      .get-in-touch {
        font-weight: 600;
      }
      .contact-details {
        display: inline-flex;
        padding: 10px;
      }
      .contact-details > div {
        padding: 0 5px;
      }
      .text-contact-details {
        position: relative;
        top: -5px;
      }
      .col-6 {
        width: 700px;
        background-color: #f1b601;
        position: relative;
        top: 100;
        text-align: center;
        padding: 10px 0;
      }
      .footer-text {
        color: white;
        font-size: 18px;
        font-weight: 600;
        font-style: italic;
        padding: 10px 0;
      }
      h1 {
        color: red;
      }
      p {
        color: blue;
      }
